insert  into `plantilla`(`contenido`,`nombre`,`plantilla_id`) values ('<p style=\"text-align: center;\"><strong><span style=\"font-family: arial, sans-serif;\">ACTA N&ordm;: {2}</span></strong></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">D. {1}, por la empresa LAINSA CONTRA INCENDIOS, S.A., autorizada por la Consejer&iacute;a de Empleo, Empresa e Innovaci&oacute;n de la JUNTA DE EXTREMADURA para la recarga, revisi&oacute;n y mantenimiento de extintores de incendios con el numero&nbsp;{0}.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p><span style=\"font-family: calibri;\">&nbsp;</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><strong><span style=\"font-family: arial, sans-serif;\">CERTIFICA:</span></strong></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">Que en cumplimiento de las disposiciones del Reglamento de Instalaciones de Protecci&oacute;n Contra Incendios y el Reglamento de Equipos a Presi&oacute;n, se ha procedido por parte del personal t&eacute;cnico de esta Empresa al reconocimiento y prueba de presi&oacute;n de extintores y botellines de impulsi&oacute;n, cuyas caracter&iacute;sticas se detallan en las siguientes relaciones que se adjuntan.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">Hojas de la 1 a la 1.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">Revisados los aparatos y comprobados sus dispositivos de funcionamiento y seguridad, cumplen los requisitos reglamentarios.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">En consecuencia, ha sido marcada la placa del timbre con fecha: <strong>10-11, 11-11 &oacute; 12-11</strong> seg&uacute;n correspondiera y sello.</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">Y para que conste y surta efectos legales, se extiende el presente a <strong>{3}.</strong></span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"> </p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Fdo. {1}</span></p>\r\n<p> </p>\r\n<p style=\"text-align: justify;\"><span style=\"font-family: arial, sans-serif;\">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; &nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; Ingeniero T&eacute;cnico Industrial</span></p>','Carta Acta de Prueba Hidrostàtica',1);
